description:
Category All Girl, Girl-Girl, Lesbian

 Director Nica Noelle
 Starring Chastity Lynn, Magdalene St. Michaels, Jelena Jensen, Sovereign Syre, Sophia Jade, Ela Darling

 Written and Directed By: Nica Noelle!

 The secret life of lesbian guidance counselor Sophie Hobbs (Sovereign Syre) begins to unravel when Professor St. Michaels (Magdalene St. Michaels) learns of Sophie's tryst with the older woman's favorite student (Gracie Glam). Determined to get rid of the troublesome Sophie, Magdalene hires gorgeous new student (Jelena Jensen) to give the unethical Ms. Hobbs some much-needed competition. But as Sophie struggles to control her lesbian urges, curvy student Bella (Sophia Jade) proves the sec-crazed counselor still can't resist a hot, young girl!


